const url = `http://localhost:3000`;
const picture = PictureInput
const Toast = Swal.mixin({
  toast: true,
  position: 'center',
  showConfirmButton: false,
  timer: 3000
});


const app = new Vue({
  el: "#app",
  data: {
    loading: false,
    tags: [],
    show: {
      myImage: false,
      allImage: true,
      islogin: false,
      image: false
    },
    register: {
      name: "",
      email: "",
      password: ""
    },
    login: {
      email: "",
      password: ""
    },
    error: {
      register: "",
      login: "",
      fetch: ""
    },
    searchImage: "",
    images: [],
    userImages: []
  },
  components: {
    "picture-input": PictureInput
  },
  methods: {

    searchingImage(){
      this.findAll(() => {
        if(this.searchImage != ""){
          let arr = []
          this.images.forEach((image) => {
            let temp = image.tags.join("").toLowerCase()
            if (temp.includes(this.searchImage)){
              arr.push(image)
            }
          })
          this.images = arr
        }
      })
    },
    showImage() {
      if (this.show.image == false) {
        this.show.image = true;
      } else if (this.show.image == true) {
        this.show.image = false;
      }
    },
    userRegister() {
      this.error.register = "";
      axios({
        method: "POST",
        url: `${url}/signup`,
        data: {
          name: this.register.name,
          email: this.register.email,
          password: this.register.password
        }
      })
        .then(({ data }) => {
          this.register.name = "";
          this.register.email = "";
          this.register.password = "";
          Toast.fire({
            type: 'success',
            title: 'Register Success, You can login now'
          })
        })
        .catch(error => {
          this.error.register = `Error: ${error.response.data.message}`;
        });
    },
    userLogin() {
      this.errorLogin = "";
      axios({
        method: "POST",
        url: `${url}/signin`,
        data: {
          email: this.login.email,
          password: this.login.password
        }
      })
        .then(({ data }) => {
          localStorage.setItem("token", data.token);
          localStorage.setItem("id", data.id);
          this.findAll();
          console.log(localStorage);
          this.show.islogin = true;
          Toast.fire({
            type: 'success',
            title: 'Logged in successfully'
          })
        })
        .catch(error => {
          this.error.login = `Error: ${error}`;
        });
    },
    logout() {
      Swal.fire({
        title: 'Gotta go?',
        showCancelButton: true,
        confirmButtonColor: '#3085d6',
        cancelButtonColor: '#d33',
        confirmButtonText: 'Yes !'
      }).then((result) => {
        if (result.value) {
          localStorage.clear();
          this.show.islogin = false;
          Toast.fire({
            title: 'Logged out successfully'
          })
        }
      })
    },
    findAll(cb) {
      axios({
        method: "GET",
        url: `${url}/image`,
        headers: {
          token: localStorage.getItem("token")
        }
      })
        .then(({ data }) => {
          console.log(data)
          this.images = data;
          if(cb){
            cb()
          }
        })
        .catch(error => {
          this.error.login = `Error: ${error}`;
        });
    },
    findUserImage() {
      axios({
        method: "GET",
        url: `${url}/image?find=user`,
        headers: {
          token: localStorage.getItem("token")
        }
      })
        .then(({ data }) => {
          this.userImages = data;
          console.log(data);
        })
        .catch(error => {
          this.error.login = `Error: ${error}`;
        });
    },
    tes() {
      console.log(this.$refs.pictureInput)
      console.log(this.$refs.pictureInput.file);
      console.log(this.tags);

      let newImage = new FormData();
      newImage.append("image", this.$refs.pictureInput.file);
      newImage.append("tags", this.tags);
      console.log(newImage);

      this.loading = true

      axios({
        url: `${url}/image`,
        method: "post",
        data: newImage,
        headers: {
          token: localStorage.getItem("token")
        }
      })
        .then(({ data }) => {
          this.loading = false
          this.show.image = false
          this.show.allImage = true
          this.findAll();
          Toast.fire({
            type: 'success',
            title: 'Image posted successully'
          })
          console.log(data);
        })
        .catch(err => {
          console.log(err);
        });
    },
    deleteImage(id) {
      Swal.fire({
        title: 'Delete this image?',
        type: 'warning',
        showCancelButton: true,
        confirmButtonColor: '#3085d6',
        cancelButtonColor: '#d33',
        confirmButtonText: 'Yes!'
      }).then((result) => {
        if (result.value) {
          axios({
            url: `${url}/image/${id}`,
            method: "DELETE",
            headers: {
              token: localStorage.getItem("token")
            }
          })
            .then(({ data }) => {
              this.showMyImage();
              Toast.fire({
                type: 'success',
                title: 'Image deleted'
              })
              console.log(data);
            })
            .catch(err => {
              console.log(err);
            });
        }
      })

    },
    showMyImage() {
      this.show.allImage = false;
      this.show.myImage = true;
      this.show.image = false;
      this.findUserImage()
    },
    showAllImage() {
      this.show.allImage = true;
      this.show.myImage = false;
      this.show.image = false;
      this.findAll();
    },

    isVote(imageId) {
      let image = this.images.find(image => {
        return image._id === imageId
      })
      if (image.voters.indexOf(localStorage.id) === -1) {
        return false
      } else {
        return true
      }
    },

    vote(id, option) {
      console.log('masuk vote')
      axios({
        url: `${url}/image/${id}`,
        method: "patch",
        data: {
          option: option
        },
        headers: {
          token: localStorage.getItem("token")
        }
      })
      .then(({data}) => {
        console.log(data)
        this.findAll()
      })
      .catch(err => {
        console.log(err)
      })
    }
  },

  computed: {
  },

  created() {

    if (localStorage.getItem("token")) {
      console.log(localStorage.id)
      // console.log(this.$refs.pictureInput)
      this.show.islogin = true;
      this.findAll();
    }
  }
});
